import React from "react";
import { Link } from "react-router-dom";
import "../../css/404Page.css"; // We'll create this CSS file next

const NotFoundPage = () => {
  return (
    <div className="not-found-container">
      <h1>404 - Page Not Found</h1>
      <div className="dumbbell-container">
        <div className="dumbbell">
          <div className="plate left"></div>
          <div className="bar"></div>
          <div className="plate right"></div>
        </div>
      </div>
      <p>Oops! This page is taking a rest day.</p>
      <p>Looks like you've wandered off the fitness track!</p>
      <Link to="/" className="home-button">
        Return to Home
      </Link>
    </div>
  );
};

export default NotFoundPage;
